import React, { Component } from 'react';
import './App.css';

class App extends Component {
  
  constructor(props){
    super(props);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.state={ 
      userId:"", 
      Name:"",
      videoOne: "",
      videoTwo: ""
    } 
  }

  handleSubmit(event){ 
    event.preventDefault();
    fetch('/', {
     method: 'post',
     headers: {'Content-Type':'application/json'},
     body: JSON.stringify({
      "userId": this.state.userId,
      "Name": this.state.Name,
      "videoOne": this.state.videoOne,
      "videoTwo": this.state.videoTwo
     })
    });
   }

  render() {
    return (
      <div className="user-input">
      <h1> Welcome to the Kaltura video formatting application! </h1>
      <h3> Please input your videos information in the fields below and click submit, after hitting submit your formatted xml file should download automatically. </h3>
        <form onSubmit={this.handleSubmit}>
          <label>Email:</label> <br/>
          <input ref={(ref) => {this.email = ref}} placeholder="User Email" className="textbox" type="text" value={this.state.userId} onChange={(ev)=>this.setState({userId:ev.target.value})}/>
          <br/>
          <label>Video Title:</label><br/>
          <input ref={(ref) => {this.videotitle = ref}} placeholder="Title of Video" className="textbox" type="text" value={this.state.Name} onChange={(ev)=>this.setState({Name:ev.target.value})}/>
          <br/>
          <label>Video One:</label><br/>
          <input ref={(ref) => {this.videoone = ref}} placeholder="First Video" className="textbox" type="text" value={this.state.videoOne} onChange={(ev)=>this.setState({videoOne:ev.target.value})}/>
          <br/>
          <label>Video Two:</label><br/>
          <input ref={(ref) => {this.videotwo = ref}} placeholder="Second Video" className="textbox" type="text" value={this.state.videoTwo} onChange={(ev)=>this.setState({videoTwo:ev.target.value})}/>
          <br/><br/>
          <input className="submit" type="submit" value="Submit"/>
        </form> 
      </div>
    );
  }
}

export default App;
